import Customer from "./component/Customer";
import Topmenu from "./component/Topmenu";

function App() {
  return (
      <>
        <body class="hold-transition skin-blue layout-top-nav">
          <div class="wrapper">
            <Topmenu></Topmenu>
            <Customer></Customer>
          </div>
        </body>
    </>
  );
}

export default App;
